const ADD_CITY = "city/add";
const REMOVE_CITY = "city/remove";
const UPD_WEATHER = "wheather/upd";
const CITY_PAGE_WEATHER = "wheather/cityPageWeather";
const ERROR = "error";
const LOADING = "loading";

let action = {
  ADD_CITY,
  REMOVE_CITY,
  UPD_WEATHER,
  CITY_PAGE_WEATHER,
  ERROR,
  LOADING,
};
export default action;
